/* eslint-disable @typescript-eslint/member-delimiter-style */
import styled from "styled-components";

interface ICustomInput {
  customBackgroundColor?: string;
  customColor?: string;
  customBorderColor?: string;
  width?: string;
  customMarginTop?: string;
  customPadding?: string;
  scheduleScreen: boolean;
}

export const StylezedInput = styled.input<ICustomInput>`
  padding: ${(props) => (props.customPadding ? props.customPadding : "0px")};
  width: 458px;
  height: 44px;
  border: 1px solid #3e5b5b;
  border-radius: 5px;
  top: 306px;
  left: 830px;

  ${(props) =>
    props.leftSubContainer &&
    css`
      margin: 64px 208px 60px 103px;
      justify-content: space-between;
      height: 100%;
    `};
`;
